  let mkRect (x: int) (y: int) (color: string) =
    Svg.rect [
      Attr.x x
      Attr.y y
      Attr.width 200
      Attr.height 200
      Attr.style [ Css.fill color ]
    ]

  let mkPath (x: int) (y: int) (d: string) (color: string) =
    Svg.svgel "path" [
      Attr.style [
        Css.fill color
        Css.transformTranslate (x,y)
      ]
      Attr.d d
    ]

